      //   <Result_List className="list" key={el.aca_id} >
      //     {el.i}

      //     </Result_List>
      //   )
      // }
      return (

        // <Result_List className="list" key={el.aca_id} >
        //   {el.aca_grade}

        //   </Result_List>
        <Result_List>

          <div>{el.aca_name}</div>
          <div>{el.aca_grade}</div>
          <div>{el.location}</div>
          <div>{el.review}</div>
          <div>{el.score}</div>

        </Result_List>


      )
    })}

    </ListContainer>
  );
}
